import React, { Component } from "react";
import {Col, Row, Container} from "../components/Grid";
import Nav from "../components/Nav";
import OutlineBtn from "../components/DeleteBtn/index.js";
import logo from "../images/logo_2.png";
import strawberry from "../images/strawberry.png";
import ("../pages/home.css");



class Home extends Component {
    render(){
        return(
            <Container>
                        <Nav style={{height:100, right:10}}>
                                <a className="navbar-brand" href="/">
                                    <img src={logo} alt="logo"/> 
                                </a>
                                <Col size="sm md lg xl"></Col>
                                <Col size="sm md lg xl"></Col>
                                <Col size="sm md lg xl"></Col>
                                <Col size="sm md lg xl">
                                <OutlineBtn style={{marginLeft:10}}>Account</OutlineBtn>
                                <OutlineBtn style={{alignSelf:"right"}}>
                                    <i className="fas fa-sign-in-alt">Log-Out</i>
                                </OutlineBtn>
                                
                                </Col>
                        </Nav>
                   
                <Row >
                    <div className="highest-rated fluid">{/**formerly test  */}
                        <img src={strawberry} alt="strawberry fluid" style={{opacity:"0.7", width:1570, marginTop:100}}/>
                        </div>
                    </Row>
                    
            </Container>
        )
    }
}

export default Home;
